const cache = {};

export default class Symbol {
  constructor(name = Symbol.random()) {
    this.name = name;

    this.slots = {
      slot1: 'data:image/png;base64,\n',
      slot2: 'data:image/png;base64,\n',
      slot3: 'data:image/png;base64,\n',
      slot4: 'data:image/png;base64,\n',
      slot5: 'data:image/png;base64,\n',
      slot6: 'data:image/png;base64,\n',
      slot7: 'data:image/png;base64,\n',
      slot8: 'data:image/png;base64,\n',
    };

    if (cache[name]) {
      this.img = cache[name].cloneNode();
    } else {
      this.img = new Image();
      this.img.src = this.slots[name];
      cache[name] = this.img;
    }
  }

  static preload() {
    Symbol.symbols.forEach(symbol => new Symbol(symbol));
  }

  static get symbols() {
    return ['slot1', 'slot2', 'slot3', 'slot4', 'slot5', 'slot6', 'slot7', 'slot8', 'slot2'];
  }

  static random() {
    return this.symbols[Math.floor(Math.random()*this.symbols.length)];
  }
}
